CREATE TABLE T_ORDER (
    id INTEGER NOT NULL,
    customer_id INTEGER,
    timestamp_order DATETIME NOT NULL,
    status_order INTEGER(1) NOT NULL /* 1 - received, 2 - in realisation, 3 - sent, 4 - delivered, 5 - returned, 9 - cancelled*/,
    status_payment INTEGER(1) NOT NULL /* 1 - confirmed, 2 - in progress, 3 - to be paid ,9 - rejected*/,
    PRIMARY KEY (id),
    FOREIGN KEY (customer_id)
        REFERENCES T_CUSTOMER(id)
        ON DELETE SET NULL
);

